import React, { useEffect, useMemo, useState } from 'react';
import { Link } from 'react-router-dom';
import { listEvents } from '../lib/calendar';
import Countdown from '../components/Countdown';

export default function Dashboard() {
  const [anniv, setAnniv] = useState(() => localStorage.getItem('anniversary'));
  const [events, setEvents] = useState([]);
  const [loading, setLoading] = useState(true);

  const daysTogether = useMemo(() => {
    if (!anniv) return null;
    const start = new Date(anniv);
    const now = new Date();
    const diff = Math.floor((now - start) / (1000 * 60 * 60 * 24));
    return diff;
  }, [anniv]);

  useEffect(() => {
    const onStorage = () => setAnniv(localStorage.getItem('anniversary'));
    window.addEventListener('storage', onStorage);
    return () => window.removeEventListener('storage', onStorage);
  }, []);

  useEffect(() => {
    let isCancelled = false;
    async function fetchEvents() {
      setLoading(true);
      try {
        const pairId = localStorage.getItem('pairId');
        if (pairId && !isCancelled) {
          const upcomingEvents = await listEvents(pairId, { futureOnly: true, max: 3 });
          setEvents(upcomingEvents);
        }
      } catch (error) {
        console.error("Error fetching events:", error);
      } finally {
        if (!isCancelled) setLoading(false);
      }
    }
    fetchEvents();
    return () => { isCancelled = true; };
  }, []);

  const nextEvent = useMemo(() => {
    if (events.length > 0) return events[0];
    return null;
  }, [events]);

  return (
    <div className="space-y-4">
      {daysTogether !== null ? (
        <div className="card">
          <div className="text-sm text-gray-600">Llevamos</div>
          <div className="text-3xl font-semibold text-rose-600">{daysTogether} d√≠as</div>
        </div>
      ) : (
        <div className="card">
          <div className="text-sm text-gray-600">Configura tu aniversario en Ajustes</div>
          <Link to="/settings" className="inline-block mt-2 btn-primary">Ir a Ajustes</Link>
        </div>
      )}

      {nextEvent && (
        <div className="card">
          <div className="text-sm text-gray-600">Pr√≥ximo evento</div>
          <div className="text-lg font-semibold text-gray-900 mb-2">{nextEvent.title}</div>
          <Countdown toDate={nextEvent.start.toDate()} />
        </div>
      )}

      <div className="card">
        <div className="flex items-center justify-between mb-2">
          <h3 className="font-semibold text-gray-900">Pr√≥ximos eventos</h3>
          <Link to="/calendar" className="btn-link text-sm">Ver calendario</Link>
        </div>
        {loading ? (
          <p className="text-gray-500">Cargando eventos...</p>
        ) : events.length > 0 ? (
          <ul className="space-y-2">
            {events.map(ev => {
              const d = ev.start?.toDate?.();
              const when = d ? d.toLocaleDateString('es-ES', { month: 'long', day: 'numeric' }) : '';
              return (
                <li key={ev.id} className="text-sm flex items-baseline gap-2">
                  <span className="font-medium text-gray-800">{ev.title}</span>
                  <span className="text-xs text-gray-500">{when}</span>
                </li>
              );
            })}
          </ul>
        ) : (
          <p className="text-gray-500">No hay pr√≥ximos eventos. ¬°Crea el primero!</p>
        )}
      </div>

      <div className="grid grid-cols-2 gap-3">
        <Link to="/gallery" className="block rounded-2xl bg-gradient-to-br from-rose-100 to-white border border-rose-200 p-4 text-center transition hover:shadow-sm hover:border-rose-300">üì∑<div className="mt-1 text-sm">Galer√≠a</div></Link>
        <Link to="/map" className="block rounded-2xl bg-gradient-to-br from-rose-100 to-white border border-rose-200 p-4 text-center transition hover:shadow-sm hover:border-rose-300">üó∫Ô∏è<div className="mt-1 text-sm">Mapa</div></Link>
      </div>
    </div>
  );
}
